Actionscript.script:
循环次数 = 0;
循环百分比消耗 = Math.min(Math.ceil(_parent.mp满血值 * 0.01), 200);//取整
循环消耗 = 100 + 循环百分比消耗;

if (_parent.上行){
	gotoAndPlay("龟牌气功向上");
}

循环次数 ++;
if(循环次数 < _parent.技能等级 && 循环消耗 < _parent.mp && _parent._name == _root.控制目标 && Key.isDown(_parent.技能按键值) == true)
{
	_parent.mp -= 循环消耗;
	gotoAndPlay("龟派气功循环");
}

循环次数 ++;
if(循环次数 < _parent.技能等级 && 循环消耗 < _parent.mp && _parent._name == _root.控制目标 && Key.isDown(_parent.技能按键值) == true)
{
	_parent.mp -= 循环消耗;
	gotoAndPlay("龟派气功向上循环");
}

onClipEvent (enterFrame) {
	_parent.攻击时移动(-3,-3);
	//_parent.攻击时可改变移动方向(0);
}

